// src/pages/Home.js
import React from 'react';
import Main from '../components/Main';
import FeatureSection from '../components/FeatureSection';
import InfoTabsSection from '../components/InfoTabsSection';

function Home() {
  return (
    <div>
      <Main />
      <FeatureSection />
      <InfoTabsSection /> {/* New section added here */}
    </div>
  );
}

export default Home;
